    false,nt"url": null,nt"notes": "This annual narrative report for Sand Lake
    NWR outlines Refuge accomplishments during the 1983 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses research and
    investigations. Refuge administration is outlined; information about personnel,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands, croplands, grasslands, grazing,
    haying, fire management, and pest control. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, game mammals, fisheries resources, wildlife propagation,
    scientific collections, animal control, marking and bird banding, and disease control.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, hunting, fishing, trapping, wildlife observation, and law
    enforcement. The equipment and facilities section of the report provides information
    about rehabilitation, equipment replacement, communication systems, and energy conservation.
    Cooperative programs and items of interest are provided at the end.",nt"license_title":
